  \"a-general-approach-for-associating-standardized-vegetation-classes-with-survey-locations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Linking natural resources surveys to a
  standardized set of vegetation classes increases the long-term value of the survey
  data and supports data analysis at broad spatial scales (landscapes or ecoregions).
  This SOP provides guidance for associating standardized and mapped vegetation classes
  (hereafter referred to as u2018vegetation classesu2019) with natural resources data
  collected at points or polygons. The SOP can be used in any terrestrial or wetland
  survey when a minimum documentation of vegetation is needed.\",\n\t\"license_title\":
